import React, { useState } from 'react';
import axios from 'axios';
import { useLocation, useNavigate } from 'react-router-dom';

const SetNewPasswordForm = () => {
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const location = useLocation();
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/users/api/password_reset/confirm/', {
        password,
        token: location.search.split('=')[1], // استخراج الرمز المميز من معلمات الاستعلام
      });
      // ... (معالجة الاستجابة، على سبيل المثال، إعادة التوجيه إلى صفحة تسجيل الدخول)
      navigate('/login');
    } catch (error) {
      // ... (معالجة الأخطاء)
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="email" placeholder="Email"  required />
      <button type="submit">Change password</button>
    </form>
  );
};

export default SetNewPasswordForm;
